Jasmine and her punk rock band are in tour in Europe. As they chill in their van, a cop car pulls up behind them. Max, a cop, walks up to them suspecting that they may have drugs. Max makes the girls line up on the side of the van inspecting their asses and takes them to the station. He summons Jasmine into the interrogation room. As Jasmine challenges and berates Max, he performs a body cavity search on her. The procedure quickly turns sexual.
